import { useEffect, useState } from "react"
import axios from "axios"
import  Cookie  from "universal-cookie"
import { Loading } from "../../import"
import { Link } from "react-router-dom"


const Transhistory = () => {
    const [costumers , setCostumers] = useState([])
    const [run , setRun] = useState(0)
    const [loading , setLoading] = useState(false)
    const cookie = new Cookie()
    const token = cookie.get('bearer')
    useEffect(()=>{
        axios.get('http://127.0.0.1:8000/api/TransactionReport',{
            headers:{
                Authorization: 'Bearer '+token
            }
        }).then(res => setCostumers(res.data.data))
        //eslint-disable-next-line react-hooks/exhaustive-deps
    },[run])


    // async function delet(id) {
    //     setLoading(true)
    //     try{
    //         await axios.delete(`http://127.0.0.1:8000/api/customers/${id}`,{
    //             headers:{
    //                 Authorization : 'Bearer '+token
    //             }
    //         })
    //         setRun( (prev)=> prev + 1)
    //         setLoading(false)
    //     }catch(err){
    //         console.log(err)
    //         setLoading(false)
    //     }
    // }


    let tr = costumers.map((item,index)=>{
        return<tr key={index}>
        <td>{index + 1}</td>
        <td>{item.FromCustomer}</td>
        <td>{item.AccountNumberFrom}</td>
        <td>{item.ToCustomer}</td>
        <td>{item.AccountNumberTo}</td>
        <td>{item.balance}</td>
        <td>{item.description}</td>
        <td>{item.trans_date}</td>
        {/* <td>
        <i className="fa-solid fa-trash" style={{'color':'#11101D','padding':'0px 10px','cursor':'pointer'}} onClick={()=>delet(item.id)}></i>
        <Link to={`${item.id}`}>
        <i className="fa-solid fa-pen" style={{'color':'#f00','cursor':'pointer'}}></i>
        </Link>
        </td> */}
        </tr>
       })
  return (
    <>
    {loading && <Loading />}
    <table dir='rtl'>
        <thead >
            <tr>
                <th>  المعرف</th>
                <th>  المرسل</th>
                <th> رقم الحساب</th>
                <th>المستقبل</th>
                <th> رقم الحساب</th>
                <th>القيمة</th>
                <th>ملاحظات</th>
                <th>التاريخ</th>
            </tr>
        </thead>
        <tbody>
            {tr}
        </tbody>
    </table>
</>
  )
}

export default Transhistory
